 I'm trying to find a way to close the previously opened Tooltip when a new one is opened.

Here is the code:

\begin{code}
import React, from 'react';
import { Tooltip } from 'react-tooltip';

const TooltipComponent = ({ children, content }) => {
  const [isOpen, setIsOpen] = React.useState(false);

  const handleMouseOver = () => {
    setIsOpen(true);
  };

  const handleMouseOut = () => {
    setIsOpen(false);
  };

  return (
    <React.Fragment>
      <Tooltip
        id="tooltip"
        isOpen={isOpen}
        content={content}
        place="top"
        className="tooltip"
      >
        {children}
      </Tooltip>
    </React.Fragment>
  );
};

export default TooltipComponent;
\end{code}

I want to close the previously opened Tooltip when a new one is opened. How can I achieve this?

Answer: You can achieve this by using React Context API to manage the state of the tooltips globally.

Here is the updated code:

\begin{code}
import React, { createContext, useState } from 'react';
import { Tooltip } from 'react-tooltip';

// Create a context
const TooltipContext = createContext();

// Create a provider
const TooltipProvider = ({ children }) => {
  const [activeTooltip, setActiveTooltip] = useState(null);

  const handleMouseOver = (id) => {
    setActiveTooltip(id);
  };

  const handleMouseOut = () => {
    setActiveTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ activeTooltip, handleMouseOver, handleMouseOut }}>
      {children}
    </TooltipContext.Provider>
  );
};

// Update the TooltipComponent to use the context
const TooltipComponent = ({ children, content, id }) => {
  const { activeTooltip, handleMouseOver, handleMouseOut } = useContext(TooltipContext);

  return (
    <React.Fragment>
      <Tooltip
        id={id}
        isOpen={activeTooltip === id}
        content={content}
        place="top"
        className="tooltip"
        onMouseOver={() => handleMouseOver(id)}
        onMouseOut={handleMouseOut}
      >
        {children}
      </Tooltip>
    </React.Fragment>
  );
};

// Wrap your app with the provider
const App = () => {
  return (
    <TooltipProvider>
      // Your app components here
    </TooltipProvider>
  );
};
\`

This way, you can manage the state of the tooltips globally and close the previously opened tooltip when a new one is opened.
